import './Part.css';
import moneyclipLineAnimation from '../../../lotties/moneyclip/underlines/moneyclip-line.json';

import lottie from 'lottie-web';
import { useEffect } from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function Part() {
  useEffect(() => {
    setTimeout(() => {
      lottie.loadAnimation({
        container: document.querySelector("#mc-header__work-animation"),
        animationData: workAnimation,
        loop: false,
        rendererSettings: { preserveAspectRatio: 'xMidYMid slice' }
      });
      lottie.loadAnimation({
        container: document.querySelector("#mc-header__way-you-live-animation"),
        animationData: wayYouLiveAnimation,
        loop: false,
        rendererSettings: { preserveAspectRatio: 'xMidYMid slice' }
      });
    }, 1500)
  }, []);

  return (
    <div className="mc-part__bg">
      <Container>
        <Row>
          <Col xs={12}>
            <div className="mc-part__card">
              <h2 className="mc-part__heading heading1">Seamless is part of Wellfield.</h2>
              <p className="mc-part__body p1">Wellfield receives transaction fees from trades processed by the Seamless protocol, no matter the app or wallet being used.</p>
            </div>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default Part;
